function gencodeTPV(size)
{
    /* There are no O/0 in the codes in order to avoid confusion */
    var chars = "123456789ABCDEFGHIJKLMNPQRSTUVWXYZ";
    var codeTPV = "";
    for (var i = 1; i <= size; ++i) {
        codeTPV += chars.charAt(Math.floor(Math.random() * chars.length));
    }
    $('#'+$.mobile.activePage.attr('id')+' .code').val(codeTPV);
    $('#'+$.mobile.activePage.attr('id')+' .code').phAnim();
}
