function quitarCabeceras(force){
    var navSidebar = $('#nav-sidebar').css('display');
    var navTopbar = $('#nav-topbar').css('display');
    var pageHead = $('.page-head').css('display');
    var header = $('#header').css('display');
    var multishop = $('.multishop_toolbar').css('display');
    var anchura = $(window).width();
    if(force == 'toggle' ){
        if(version < 1.6){
            (multishop == 'block') ? $('.multishop_toolbar').hide() : $('.multishop_toolbar').show();
        }else{
            if(bo_menu == 1){
                if($('#content').css('margin-left') == "0px" ){
                    $('#content').css('margin-left','');
                    $('#content').css('padding','');
                }else{
                    $('#content').css('margin-left','0px');
                    $('#content').css('padding',0);
                }
            }
            (navSidebar == 'block') ? $('#nav-sidebar').hide() : $('#nav-sidebar').show();
            (navTopbar == 'block') ? $('#nav-topbar').hide() :	$('#nav-topbar').show();
            (pageHead == 'block') ? $('.page-head').hide() :  $('.page-head').show();
        }
        if(header == 'block'){
            $('#header').hide();
        }else{
            $('#header').show();
        }
        if(anchura < 400)
            $("#flecha").hide();
        if($('#menuBarPos').hasClass('expandido')){
            $('#menuBarPos').removeClass('expandido');
            $('#productos').removeClass('expandido');
            $('#content').removeClass('expandido');
            $('#contCompra').removeClass('expandido');
            $('#contSlide').removeClass('expandido');
            $('body').removeClass("fullscreen");
        }else{
            $('#menuBarPos').addClass('expandido');
            $('#productos').addClass('expandido');
            $('#contCompra').addClass('expandido');
            $('#contSlide').addClass('expandido');
            $('#content').addClass('expandido');
            $('body').addClass("fullscreen");
        }
    }
    toggleFullScreen();
}
function toggleFullScreen() {
    if (!document.fullscreenElement &&    // alternative standard method
            !document.mozFullScreenElement && !document.webkitFullscreenElement && !document.msFullscreenElement ) {  // current working methods
        if (document.documentElement.requestFullscreen) {
            document.documentElement.requestFullscreen();
        } else if (document.documentElement.msRequestFullscreen) {
            document.documentElement.msRequestFullscreen();
        } else if (document.documentElement.mozRequestFullScreen) {
            document.documentElement.mozRequestFullScreen();
        } else if (document.documentElement.webkitRequestFullscreen) {
            document.documentElement.webkitRequestFullscreen(Element.ALLOW_KEYBOARD_INPUT);
        }
    } else {
        if (document.exitFullscreen) {
            document.exitFullscreen();
        } else if (document.msExitFullscreen) {
            document.msExitFullscreen();
        } else if (document.mozCancelFullScreen) {
            document.mozCancelFullScreen();
        } else if (document.webkitExitFullscreen) {
            document.webkitExitFullscreen();
        }
    }
}
